import React from 'react'
import { MDBBtn,MDBCard,MDBCardTitle, MDBCardText,MDBCardImage,MDBCardBody} from 'mdbreact';
import {Link} from 'react-router-dom'

export default function Home() {
    return (
<div className=" col-12 col-md-10 ">
    <MDBCard style={{ width: "22rem" }}>
    <MDBCardImage className="img-fluid" src='../assets/react.png' waves />
    <MDBCardBody>
      <MDBCardTitle  className='row justify-content-center'>My Choose</MDBCardTitle>

    </MDBCardBody>
  </MDBCard>
</div> 
    )
}
